<p>首先的第一个坑就是，当我创建这个markdown之后，发现在首页和侧边栏都找不到他，理论上应该自动添加到侧边栏的文章栏目下，而且我给这个文章加了星标<code>sticky: true</code>配置，理论应该出现在首页，但是却并没有出现，很奇怪。</p>
